    false,nt"url": null,nt"notes": "This annual work plan for U.S. Fish and
    Wildlife Service, National Wildlife Refuge System, Region 4, Inventory and Monitoring
    Program (I&M) outlines the implementation of the National Wildlife Refuge System
    program at the regional and field station level during fiscal year 2011. The purpose
    of the National Wildlife Refuge System I&M Program is to collect and synthesize
    information which supports management at multiple geographic scales and informs
    decisions at all organizational levels. This document discusses the following; present
    vision and objectives for regional inventory and monitoring initiative, staffing,
    and planned activities and anticipated products.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
